import { useState } from "react";

function DomainReportCard() {
  const [input, setInput] = useState("");
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!input) {
      setError("Please enter domain or email");
      return;
    }

    setLoading(true);
    setError("");
    setData(null);

    try {
      const res = await fetch("http://localhost:5000/api/domain", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ user_input: input }),
      });

      const result = await res.json();
      if (result.success) {
        setData(result.result);
      } else {
        setError(result.message || "No data found");
      }
    } catch (err) {
      setError("Failed to fetch report");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ fontFamily: "Arial, sans-serif", maxWidth: "700px", margin: "auto" }}>
      <h1>Check Domain / Email</h1>
      <form onSubmit={handleSearch} style={{ marginBottom: "20px" }}>
        <input
          type="text"
          placeholder="Enter domain or email"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          style={{ padding: "10px", width: "70%", marginRight: "10px" }}
        />
        <button type="submit" disabled={loading} style={{ padding: "10px 15px" }}>
          {loading ? "Checking..." : "Search"}
        </button>
      </form>

      {error && <p style={{ color: "red" }}>{error}</p>}

      {data && (
        <div
          style={{
            border: "1px solid #ccc",
            borderRadius: "12px",
            padding: "20px",
            boxShadow: "0px 4px 10px rgba(0,0,0,0.1)",
          }}
        >
          <h2 style={{ textAlign: "center" }}>Dark Web Risk Report</h2>

          <div style={{ textAlign: "center", margin: "20px 0" }}>
            <div style={{ fontSize: "48px", fontWeight: "bold", color: "#ff4d6d" }}>
              {data.risk_score || "N/A"}
            </div>
            <div>Risk Score</div>
          </div>

          <p><strong>Domain / Email:</strong> {input}</p>
          <p><strong>CDS Count:</strong> {data.cds_count}</p>
          <p><strong>UB Count:</strong> {data.ub_count}</p>
          <p><strong>CL Count:</strong> {data.cl_count}</p>

          {/* CDS Data */}
          {data.cds_data.length > 0 && (
            <div>
              <h4>CDS Data:</h4>
              {data.cds_data.map((item, i) => (
                <pre key={i}>{JSON.stringify(item, null, 2)}</pre>
              ))}
            </div>
          )}

          {/* UB Data */}
          {data.ub_data.length > 0 && (
            <div>
              <h4>UB Data:</h4>
              {data.ub_data.map((item, i) => (
                <pre key={i}>{JSON.stringify(item, null, 2)}</pre>
              ))}
            </div>
          )}

          {/* CL Data */}
          {data.cl_data.length > 0 && (
            <div>
              <h4>CL Data:</h4>
              {data.cl_data.map((item, i) => (
                <div
                  key={i}
                  style={{
                    border: "1px solid #eee",
                    padding: "10px",
                    marginBottom: "10px",
                    borderRadius: "6px",
                  }}
                >
                  <p><strong>Domain:</strong> {item.domain}</p>
                  <p><strong>Email:</strong> {item.email}</p>
                  <p><strong>Password:</strong> {item.password}</p>
                  <p><strong>Leaked Date:</strong> {item.leaked_date}</p>
                  <p><strong>Leaked From:</strong> {item.leaked_from}</p>
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default Domin;
